export default function Post() {
    return (
        <div className="post">
            <img 
                className="postImg"
                src="https://images.unsplash.com/photo-1582215669338-6cfdb76bca45?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=334&q=80" 
                alt="" />
                
        </div>
    )
}
